import React from 'react';
import {NavLink} from "react-router-dom";

const DialogsItem = (props) => {
  const path = "/dialogs/" + props.id;
  return (
      <div>
        <NavLink to={path}>{props.name}</NavLink>
      </div>
  )
}

export default DialogsItem;
